import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

//Components
import { Header } from "./components/Header";
import { MainPresentation } from "./components/MainPresentation";
import { MainIcons } from "./components/MainIcons";
import { RigthMenu } from "./components/RigthMenu";
import { AllYourNeeds } from "./components/AllYourNeeds";
import { Form } from "./components/Form";
import { Footer } from "./components/Footer";


// Style
import settings from './styles/customerPage/settings.css'

function App() {
  return (
    <React.Fragment>
      <Router>

        <switch>

          <Route path="/" exact >
            <RigthMenu />

            <header>

              <Header />

            </header>

            <main>

              <section className = 'main-presentation'>

                <MainPresentation />

              </section>

              <section className='main-icons'>

                <MainIcons />

              </section>

              <section className='all-your-needs'>

                <AllYourNeeds />

              </section>

              <section className='form'>

                <Form />

              </section>

            </main>

            <footer>

              <Footer />

            </footer>

          </Route>

        </switch>


      </Router>
    </React.Fragment>
  );
}

export default App;
